INSERT INTO `asked_question` (`id`, `asked_question_title`, `asked_question_description`, `asked_question_status`, `created_at`, `updated_at`) VALUES
(1, 'What is the Relationship Dynamics Profile?', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum commodo nisl ac pharetra aliquet.</p>', 0, '2023-03-16 07:42:40', '2023-03-16 07:42:40'),
(2, 'Is this a personality typing quiz?', '<p>The results you receive are not intended to be used as a &lsquo;Typing&rsquo; system. Many typing systems describe our identity in a more fixed and one dimensional way. It may be tempting to think of the results in this report as meaning something about you that is unchangeable. Unlike most personality typing systems, your results in this Relationship Archetype Profile can be different if you re-take the Relationship Archetype quiz at different times and with different types or relationships in mind. It&rsquo;s important to understand that no one is made of stone and this is not the kind of personality test that will tell you that you are and will always be a particular &lsquo;type&rsquo;. This Profile is meant to give you a window into how you are predominantly showing up in your relationships right now. It is a current snapshot of the most prevalent relational dynamics that are present in the relationship you had in mind and can be taken either with a romantic partner, business colleague, family member, or friend in mind.</p>', 0, '2023-03-16 07:56:26', '2023-03-16 07:56:26'),
(3, 'Do I need to take this quiz with my romantic partner?', '<p>You have the option of taking the Relationship Dynamics Quiz with or without your partner. The Relationship Dynamics profile is designed to provide comprehensive and highly relevant analysis whether you have a current or former romantic partner, business colleague, family member, or friend in mind. You can take it alone to learn about yourself. We do however encourage you to have a particular kind of relationship in mind as you are answering the questions so that your profile gives you the most accurate information about how you tend to show up in that relationship.</p>', 0, '2023-03-16 07:56:57', '2023-03-16 07:56:57'),
(4, 'I’m single right now, will this Relationship Profile still be valuable for me?', '<p>Yes. It&rsquo;s always incredibly valuable to understand yourself and others more deeply and filling out this quiz and receiving your profile when you are single is a great way for you to reflect on your past relationships and to look at the unique gifts you bring to others and the typical shadow patterns you might get caught in. This profile will help translate some of this knowledge into action as you uncover some of the remedies and relationship skills that you might want to develop. Although we recommend having a specific type of relationship in mind so that the profile accurately reflects how you tend to show up, you are welcome to reflect on your prior relationships and will gain a lot of insights that explain critically important dimensions of your particular relationship archetype.</p>', 0, '2023-03-16 07:57:18', '2023-03-16 07:57:18'),
(5, 'What happens after I take the quiz and upgrade to unlock my full profile?', '<p>After you initially take the Evolving Love Relationship Archetype Quiz, you will receive a free summary of your personalized results where 4 of the 24 sections of your profile will be unlocked. You will also have the option to purchase your full profile. When you select this option you&rsquo;ll receive a login and password that will give you access to your personalized downloadable report + a 24 lesson online course that will walk you step by step through each section of your profile explaining critically important dimensions of your relationship archetype and the various gifts, tendencies, themes, needs, communication styles, and shadow patterns to help you understand yourself and others better. In addition the step by step guide includes relational skills and remedies and 21 practices to help translate knowledge into action so help you become an even better partner.</p>', 0, '2023-03-16 07:57:39', '2023-03-16 07:57:39'),
(6, 'What’s included in the Upgraded Full Profile + Step by Step Guide?', '<p>Your FULL profile + Step by Step Guide is uniquely tailored to you and contains 24 sections and a step by step course with videos, practices, and detailed explanations of the critical dimensions of your relationship that will walk you through your personalized results.</p>', 0, '2023-03-16 07:57:59', '2023-03-16 07:57:59'),
(7, 'Can I retake this quiz?', '<p>Yes you can take this quiz as many times as you like and can profile different relationships or even profile the same relationship at different times and get an in-depth analysis of your current relationship dynamics. It&rsquo;s important to understand that no one is made of stone and even if we do tend to have some patterns and behaviors that are consistent in all our relationships, over time, as we develop, and as the people we are drawn to and are interacting with change, so do the relationship dynamics. The results you receive are not intended to be used as a &lsquo;Typing&rsquo; system. Many typing systems describe our identity in a more fixed and one dimensional way. It may be tempting to think of the results in this report as meaning something about you that is unchangeable. The summary reports will always be free but you will need to purchase the upgrade to receive the full individualized profiles.</p>', 0, '2023-03-16 07:58:22', '2023-03-16 07:58:22'),
(8, 'Will my results be different if I take the quiz with a different person in mind?', '<p>The results you receive are not intended to be used as a &lsquo;Typing&rsquo; system. Many typing systems describe our identity in a more fixed and one dimensional way. It may be tempting to think of the results in this report as meaning something about you that is unchangeable. Your results can be different if you re-take the Relationship Archetype quiz at different times and with different types or relationships in mind. It&rsquo;s important to understand that no one is made of stone and this is not the kind of personality test that will tell you that you are and will always be a particular &lsquo;type&rsquo;. This Profile is meant to give you a window into how you are predominantly showing up in your relationships right now. It is a current snapshot of the most prevalent relational dynamics that are present in the relationship you had in mind and can be taken either with a romantic partner, business colleague, family member, or friend in mind.</p>', 0, '2023-03-16 07:58:46', '2023-03-16 07:58:46'),
(9, 'Can I share my profile with others? Who can see my profile?', '<p>Yes and highly encourage it. There is a &lsquo;SHARE MY PROFILE&rsquo; button at the top of your Free Summary which will give you a special shareable link that you are welcome to send to others. In addition, if you purchased a full profile, you will receive an email in your inbox with a downloadable and shareable PDF you are welcome to send to your loved ones, business colleagues, family members, or friends. Please use the share button instead of copy pasting the URL, as this special link will allow them to see your results rather than showing a blank summary.</p>', 0, '2023-03-16 07:59:07', '2023-03-16 07:59:07'),
(11, 'Can i skips some question in quiz', '<p>yes . you can . But need paid plan for the same&nbsp;</p>', 1, '2023-05-12 07:32:44', '2023-05-12 07:32:44');
