INSERT INTO `content_references` (`id`, `type`, `about`, `feedback`, `focus`, `growth`, `created_at`) VALUES
(1, 'internal', 'A person’s reference impacts the strategies they use to construct their self-esteem, to determine how well they are doing at a particular task, how to navigate social situations, to validate or invalidate feedback from others, and to process their own emotional inner world.\nBoth “Internal” and “External” orientations consider both self and others, but each has a preferred sequence of attention, where the primary orientation tends to be considered first. People may have one reference in one relationship and a different reference with others, though it is more common for people to practice the same reference in most situations.', 'The answers you provided are consistent with an internal (self) reference which means that of the 8 Evolving Love virtues you scored higher for Freedom, Passion and Truth than their counterparts. You may have a concept of self that some identify with Western cultures and manifest destiny, represented by this quote: \n\n“Whatever the mind of [wo]man can conceive and believe it can achieve”\n- Napoleon Hill\n\nAn internally referenced person takes in information from themselves first from their own thoughts, feelings, and perspectives and then verifies with others second. An internally referenced person will assess and validate how things are going by comparing that to their own internal standards versus an externally referenced person who tends to check with the people around them before looking inside themselves. An internally referenced person gives less weight to other’s feedback than their own assessments and might even disbelieve that feedback entirely as they are aware of the social obligations and bias that can be present and the disparity in each person’s discernment.\n\nAn internally referenced person tends to be motivated by a desire to master the environment and experience their own competence, achievement, and power. In relationships, they tend to have a stronger sense of self, as they are often in touch with what they want and feel capable of getting it themselves. Someone with a strong internal reference is more likely to organize their lives in such a way that does not rely on others to get their needs met. With a high value on independence for themselves and others, they may express a preference for relationships in which neither partner depends on the other for core needs. \n\nDeveloping integrity and congruence may come naturally. Those with an internal reference are a stand for people’s sovereignty and self expression and as partners will champion everyone’s empowerment and voice.', 'Thinking patterns that are more natural to those that have a strong internal reference tend to emphasize differences and distinctions. One study found that people with this kind of focus tend to store and organize their own personal memories by “differences”. When shown a variety of random pictures and asked to recall something about what they saw, these test subjects described how the objects in the photos were different from each other or stood out in their uniqueness, where others were more likely to remember what the objects had in common. It can seem as though differences are more important to individually focused people than to others, which can sometimes be a source of conflict.\n\nThis way of thinking can even influence how people with this kind of focus answer questions for themselves like “what is true?” and “what is real?” Further psychology studies found that strongly internal referenced people would trust their own internal sense of perception far more than the perception of others, and would use a mental process of “checking in” with their core to feel a sense of congruence which they then would associate with something being true or real.', 'Those who are internally referenced may develop less emotional attunement to others and empathy may be more of a learned skill that they have to focus on consciously versus someone with an external reference on others who might do it more automatically and naturally. In addition an internally referenced person might have more trouble holding multiple perspectives at once as they sometimes discount the perspectives of others and have a harder time taking in the feedback of others making them more prone to patterns of control, avoidance, and betrayal than their more externally referenced counterparts.\n\nA strongly internally referenced person might have to remember to be more considerate of others to maintain a sense of win/win in their relationships. When win/win starts to break down with someone with this focus, more consideration from them would likely lead to a better outcome for everyone. Other areas of growth might be cooperation, flexibility, gentleness, patience, humility, and intuition. \n\nIt might take extra effort to make sure your partner feels considered in your decisions and to keep your mind and ears open even after you think you have gathered enough information to know what you want to do next. You might undervalue taking the extra time to make sure everyone’s hearts are in alignment before charging ahead, and subsequently fail to see the full cost of failing to do so.', '2023-02-07 10:53:27'),
(2, 'external', 'A person’s reference impacts the strategies they use to construct their self-esteem, determine how well they are doing at a particular task, navigate social situations, validate or invalidate feedback from others, and to process their own emotional inner world.\n\nBoth “Internal” and “External” orientations consider both self and others, but each has a preferred sequence of attention, where the primary orientation tends to be considered first. People may have one reference in one relationship and a different reference with others, though it is more common for people to practice the same reference in most situations.', 'The answers you provided are consistent with an external reference which means that of the 8 Evolving Love virtues you scored higher for Harmony, Devotion, and Partnership than their counterparts. You may have a concept of self that some identify with Eastern cultures, femininity, and the principle of Karma, represented by this quote: \n\n“We are hardwired to connect with others. It’s what gives purpose and meaning to our lives” - Brene Brown\n\nAn externally referenced person takes in information from others first, sensing the thoughts, feelings and perspectives that those around them hold and then verifies what they learned with themselves second. An externally referenced person will validate how things are going by checking with the people around them gathering external feedback versus an internally referenced person who tends to check in with their own internal standards An externally referenced person gives more weight to other’s feedback than their own assessments and might even hold loosely or even disbelieve their own perceptions as they are aware that our own perceptions are often incomplete and biased and prone to self deception.\n\nWhen “Others” oriented, a person is more driven by a desire to relate, cooperate, and connect with others than the desire to master the environment and experience their own competence, achievement, and power. In relationships, they tend to have higher quality emotional attunement to others. Empathy may come naturally to them. Those with an external reference recognize our unity and interconnectedness and are a stand for connection and compassion. With a high value on connection and emotional cohesiveness, they may express a preference for relationships in which resources are shared and alone time is sparse.', 'Thinking patterns that are more natural to those that have an external focus tend to emphasize similarities and equivalencies. One study found that people with this kind of focus tend to store and organize their own personal memories by “sameness”. When shown a variety of random pictures and asked to recall something about what they saw, these test subjects described how the objects in the photos were alike or stood out in their commonalities, where others were more likely to remember how the objects were different.\n\nThis way of thinking can even influence how people with this kind of focus answer questions for themselves like “what is true?” and “what is real?” Further psychology studies found that people who are biased towards communion would trust the common perception of others more than their own perceptions, and would use a mental process of “checking in” with the consensus of a group when determining if something was true or real. ', 'Those who are externally referenced may develop less of a sense of self as they often have a harder time getting in touch with what they want and may not always express what they need. Those with a strong group focus might have a harder time locating or experiencing their own desires, especially if they are different from those around them. They may enjoy providing experiences or fulfilling the desires of others, and can genuinely be fulfilled by experiencing the satisfaction of others. They may be happiest when they know that everyone else is happy and taken care of.\n\nDeveloping integrity and congruence may be more of a learned skill that they focus on consciously versus someone with an internal reference who might do this more automatically and naturally. Sometimes people with an external reference have a harder time developing a strong self esteem as they often seek validation from others in order to know whether they are okay making them more prone to patterns of collapse, anxiety, and co-dependence than their more internally referenced counterparts.\n\nA strongly group focused person might have to remember to have more courage in their convictions to maintain a sense of win/win in their relationships. When win/win starts to break down with someone with this focus, more courage from them would likely lead to a better outcome for everyone. \n\nOther areas of growth might be logic, independence, assertiveness, ambition, self-reliance, courage, and focus. \n\nIt might take extra effort on your part to make sure your perspective doesn’t get lost when you consider your partner in your decisions and to trust that your feelings are important especially when they don’t seem to be shared by others.', '2023-02-07 10:53:27');
