INSERT INTO `palns` (`id`, `plan_image`, `plan_title`, `plan_description`, `plan_status`) VALUES
(1, '1678795860_Evolving Love Icon - Personalized Plan (Puzzle Piece).png', 'Personalized digital plan', '<p>Receive your XX pg profile + a tailored self-guided 24 lesson program designed to improve your relationship skills. You&rsquo;ll explore detailed profiles, videos, exercises, and skills to help you master your relationship dynamics.</p>', 0),
(2, '1678796093_Evolving Love Icon - Take It Together (Two Avatars).png', 'Take it together or alone', '<p>Take it on your own and learn about yourself OR take it with a romantic partner, business colleague, family member, or friend to understand the relationship dynamics between you. You can retake this quiz anytime.</p>', 0),
(3, '1678796135_Evolving Love Icon - Comprehensive Tool (Heart Cap and Gown).png', 'A comprehensive tool', '<p>You&rsquo;ll receive the most comprehensive guide to your relationship qualities, gifts, shadow patterns, and relational skills that analyzes key areas of your partnership to to help you learn how to be a better partner</p>', 0),
(8, '1683876326_sergio-aguero-reuters.jpg', 'Need for Paid plan', '<p>Need for Paid plan</p>', 1);
