INSERT INTO `permanent_breakthrough` (`id`, `sec_1_title`, `sec_1_sub_title`, `sec_1_image`, `sec_1_des`, `sec_1_des_bellow`, `sec_1_link`, `sec_1_link_bellow`, `sec_3_title`, `sec_3_sub_title`, `sec_3_img`, `sec_4_title`, `sec_4_sub_title`, `sec_4_content`, `sec_5_img`, `sec_5_content`, `created_at`, `sec_6_image`, `sec_6_title`, `sec_6_sub_title`, `sec_6_link`, `sec_6_link_bellow`, `sec_7_title`, `sec_7_sub_title`, `sec_7_content`, `sec_8_bgimage`, `sec_8_title`, `sec_8_sub_title`, `sec_8_content`, `sec_8_image`, `sec_8_imgname`, `sec_9_img`, `sec_9_content`, `sec_10_title`, `sec_10_sub_title`, `sec_11_title`, `sec_11_content`, `sec_12_img`, `sec_12_content`, `sec_13_amount`, `sec_14_title`, `sec_14_sub_title`) VALUES
(1, 'PERMANENT RELATIONSHIP BREAKTHROUGH LIVE 8-WEEK VIRTUAL PROGRAM', 'A PRACTICAL TOOLSET TO RESOLVE ANY CONFLICT & CREATE LASTING LOVE', '1684754145_Evolving Love Product Image - Permanent Relationship Breakthrough 8 Week Course.png', 'Spend 8 Weeks of Guided Teaching, Practice & Discussions Applying Proven Conflict Resolution Strategies', 'Begins [Month Date Range Here] 2023', '#', 'Attend from anywhere - No hotels, flights, or sitters!', 'WHAT YOU’LL GET', 'whatever you want', '1686804760_images.jpg', 'WHAT TO YOU’LL LEARN', 'MASTER THE CORE RELATIONSHIP PRINCIPLES THAT CREATE PERMANENT CHANGE', '<ul>\r\n	<li>Identify the 4 most common &lsquo;toxic cycles&rsquo; at the heart of all conflict - exploring the patterns you get caught in most</li>\r\n	<li>Learn the 5 R&rsquo;s of Conflict Resolution, uncovering what you are already doing naturally and what you might bel eaving out</li>\r\n	<li>Discover specifically how you might be polarizing the people you relate to most in predictable ways and how to spot and unwind that behavior for both of you</li>\r\n	<li>Master the art of regulation, empathy, tracking, and de-escalating without giving up your truth</li>\r\n	<li>Diagnose what to do when you get triggered</li>\r\n	<li>express your needs and commit to a new future.</li>\r\n	<li>Learn how to reinterpret your blind spots and create a new narrative for your relationships.</li>\r\n	<li>Discover 8 remedies that will help you exit those common toxic cycles we get caught in so you can create more lasting love</li>\r\n	<li>Receive personalized and comprehensive insights about your Relationship Dynamics Profile to more fully understand yourself and those you are relating to now</li>\r\n	<li>Discover why being good at &ldquo;conflict resolution&rdquo; - the way it&rsquo;s normally taught - can actually hurt your relationships</li>\r\n	<li>Resolve once and for all your most painful recurring patterns and find out how to make sure your past conflicts don&rsquo;t come back to haunt your next relationship</li>\r\n	<li>Learn the critical relationship skills that will set you up to be an even better partner, collaborator, family member, or friend.</li>\r\n</ul>', '1683180191_btm_banner.png', '<p><strong>Welcome to the depths of the relational realm.</strong>&nbsp;This is where your deepest desires meet your most profound fears. It&rsquo;s where you meet the edge of your limitations and&nbsp;<strong>learn to expand beyond them</strong>.</p>\r\n\r\n<p><span>Learn to open, when you want to close.</span></p>\r\n\r\n<p><strong>This course is not for the faint of heart</strong>. It&rsquo;s for the courageous, the bold, and the daring. It&rsquo;s for those who are willing to face their shadows and transmute them into light. It&rsquo;s for those who are ready to step into their power and show up fully in their relationships.</p>\r\n\r\n<p><strong>This course is more than just a series of teachings...</strong></p>\r\n\r\n<p>It&rsquo;s an invitation to a deeper, more intimate connection with yourself and the people you are closest to..</p>\r\n\r\n<p>It&rsquo;s an opportunity to explore the depths of your desires and fears.</p>\r\n\r\n<p>It&rsquo;s a chance to embody the qualities of Freedom, Devotion, Truth, Harmony, Passion, Partnership, Possibility, and Appreciation, .</p>\r\n\r\n<p><strong>It&rsquo;s a journey of self-discovery&nbsp;</strong>and self-realization.</p>\r\n\r\n<p><span>Dare to love, no matter what.</span></p>\r\n\r\n<p>So if you&rsquo;re ready to dive deep into the depths of the relational realm,&nbsp;<strong>if you&rsquo;re ready to face your shadows</strong>&nbsp;and transmute them into light, if you&rsquo;re ready to step into your power and show up fully in your relationships, then join us on this journey of transformation.</p>\r\n\r\n<p>Let us guide you through the teachings of the 5 R’s of Conflict Resolution and help you uncover the relationship stances and shadow patterns you most often use . Let us help you awaken to the true nature of your being and experience the fullness of your feminine and masculine essence. Let us help you create extraordinary relationships that are grounded in love, trust, and authenticity.\r\n</p>\r\n\r\n<p><strong>We are here for you.</strong></p>', '2023-05-01 07:51:15', '1683182374_permanent_bnr.png', 'PERMANENT RELATIONSHIP BREAKTHROUGH:', '8-Week Live Online Course [Date Here] 2023', '#', 'Attend from anywhere - No hotels, flights, or sitters!', 'COURSE CURRICULUM', 'A DEEP DIVE INTO THE 5 R’s OF CONFLICT RESOLUTION & THE 8 EVOLUTIONARY VIRTUES THAT CREATE LASTING LOVE', '<p>Over the course of eight weeks, we&#39;ll dive into the 5 R&#39;s of Resolution, exploring each one in depth and providing you with practical tools and exercises to apply in your relationships. You&#39;ll have access to video lessons, written materials, and lively interactive group discussions, so you can both learn at your own pace and get personalized support.</p>', '1683189076_Evolving Love Sidebar & Practices Background - Red.png', 'MEET YOUR FACILITATORS BRYAN FRANKLIN & JENNIFER RUSSELL', 'CO-FOUNDERS OF THE RELATIONSHIP DYNAMICS INSTITUTE | OVER 30,000 SESSIONS', '<p>Together Jennifer and Bryan have led 20 years of impactful transformational programs and events designed to liberate people from self-imposed limiting beliefs and unlock their evolutionary potential. They incorporate the best of Neurolinguistic Programming (NLP), the human potential movement, family systems, attachment theory, collaborative systems, neuroscience, spiritual practices, tribal circling technologies, and sacred theater.</p>\r\n\r\n<p>They are the co-founders of &#39;&#39;Relationship Dynamics Institute (<a href=\"https://relationshipdynamics.com/\">https://relationshipdynamics.com</a>.), where they facilitate a series of retreats, workshops, and courses designed to rewrite your relational DNA so that you can embody your ideal love story</p>\r\n\r\n<p>They work with singles and couples to develop extraordinary relationships that point the way to significant personal evolution and the skills to develop a higher relational quotient (RQ). They are a stand for relationships that have a &#39;both / and&#39; rather than an &#39;either / or&#39; relationship to Freedom and Devotion and realize the true potential that healing the divide between the masculine and feminine ihas on creating a healed, healthy, and whole culture.</p>\r\n\r\n<p>They have developed powerful models that can help build the 3 pillars of any great relationship which are how to set the direction of your relationship, how to handle the valleys, and how to set the stage to experience the peaks.</p>', '1684759637_Evolving Love Image - Bryan and Jennifer B&W .jpeg', 'Jennifer Russell & Bryan Franklin', '1683260903_middle_bnr.png', '<p>My Dearest Sisters,</p>\r\n\r\n<p><strong>I see you, I hear you, and I feel your pain.&nbsp;</strong>.</p>\r\n\r\n<p>I want you to know that I honor your journey.</p>\r\n\r\n<p>I can sense your heart aching with a longing for healing, for a deeper<br />\r\nunderstanding and connection, for an end to the cycles of shaming and blaming<br />\r\nthat have caused so much pain in our relationships.</p>\r\n\r\n<p>My sister, you are not alone in your longing.</p>\r\n\r\n<p>The greatest power, requires the lightest touch</p>\r\n\r\n<p><strong>When we disrespect men, we disrespect ourselves.</strong></p>\r\n\r\n<p>We become desensitized and disconnected from our own feminine power.</p>\r\n\r\n<p>We forget that our unique gifts and messages for the masculine are essential for<br />\r\nthe balance of the world.</p>\r\n\r\n<p><strong>We forget that we are powerful beyond measure,</strong>&nbsp;and that we have the ability to transform the world with our love far better than with our fury.</p>\r\n\r\n<p>This course is an opportunity for us to heal the wounds that have kept us from fully expressing ourselves in our relationships to step into this space of love and transformation with us.</p>', 'IS THIS COURSE RIGHT FOR YOU?', 'WHO WILL BENEFIT MOST…AND WHO SHOULD LOOK ELSEWHERE….', 'WHO THIS COURSE IS NOT FOR', '<ul>\r\n	<li>Those who ate not interested in learning about their relationship patterns or improving their communication</li>\r\n	<li>People who are not willing to invest the time and effort necessary to create lasting change in their relationship.</li>\r\n	<li>Individuals who are looking for a magic solution to their relationship problem</li>\r\n	<li>Those who are not open-minded and willing to try new approaches to building stronger relationships</li>\r\n	<li>Couples who are in abusive or violent relationships</li>\r\n</ul>\r\n\r\n<p><strong>IMPORTANT:</strong>&nbsp;Please note that this course is not intended for couples who are in abusive or violent relationships. If you are experiencing abouse or violence in your relationship, please seek professional help immediately.</p>', '1683267284_bnr_bottom.png', '<p>Dearest Men.</p>\r\n\r\n<p><strong>We see you. We see the weight you carry,&nbsp;</strong>the burdens you bear, and the struggles you face.</p>\r\n\r\n<p>We see the depth of your heart, the passion in your soul, and the potential within you.</p>\r\n\r\n<p>You are not broken. You are simply human, with all the messy complexities and contradictions that come with that.</p>\r\n\r\n<p>And it is precisely those complexities that make you beautiful, that make you worthy of evolutionary love.</p>\r\n\r\n<p><span>Let us heal the divide between the masculine and feminine<span></p>\r\n\r\n<p>When we use our power with any force or push, it&rsquo;s a sign we might actually be feeling powerless ourselves because the greatest power, requires the lightest touch and it is in this gentle power that we learn how to wield it responsibly.</p>\r\n\r\n<p><strong>Let us heal the divide between men and women,</strong>&nbsp;and create a world where love and respect are the foundation of all our relationships.</p>', '99.00', 'FREQUENTLY ASKED QUESTIONS', 'HERE ARE SOME HELPFUL ANSWERS TO SOME OF OUR MOST COMMON QUESTIONS');
INSERT INTO `permanent_breakthrough_course` (`id`, `element_img`, `element_title`, `element_content`) VALUES
(1, '1683186883_main-1.png', 'WEEK 1: THE 5 R’s OF CONFLICT RESOLUTION - Assess Your Gifts & Challenges', '<ul>\r\n	<li>Discover the 5 essential steps to resolving conflicts permanently&nbsp;</li>\r\n	<li>Learn which of these steps you might be doing naturally and which are your growth edge</li>\r\n	<li>Practice how to turn conflict into an opportunity for healing and connection</li>\r\n</ul>'),
(2, '1684757744_Evolving Love Permanent Breakthrough Thumbnail - Week 2.png', 'WEEK 2: THE RING OF RESOLUTION INSERT INTO `permanent_breakthrough_faq` (`id`, `question`, `answer`) VALUES
(1, 'Is this course right for me if I’m in a brand new relationship', '<p>Absolutely. Budding new couples are very welcome and encouraged to take this course. We can&rsquo;t think of a better way to start a relationship than to begin with the kinds of evolutionary conversations and practices we&rsquo;ll be doing throughout this course. Taking a close look at the [insert] that had your previous relationships end is step one in creating a new relationship that doesn&rsquo;t repeat that pattern.</p>'),
(2, 'Is this course for couples only? Can I come if I’m not in a relationship now?', '<p>No this course can be taken if you are currently single.  This course is very valuable for anyone not currently in a relationship that wants practice with how to handle some of the difficulties that come up when in relationship with anyone -a romantic partner, business colleague, family member, or friend. It’s always the right time to address in yourself any patterns that might be playing themselves out in an unhealthy way in your relationship. This is true whether you happen to be single right now or in a committed partnership.</p>\r\n\r\n<p>If you are single right now, come to this course if you want to learn how to create conscious healthy relationships right from the start. Come ready to unearth the blindspots and core patterns that are likely in the way from you finding love and partnership with those around you.</p>\r\n\r\n<p>Learn how to heal insecure attachment whether you are an avoidant type who tends to run away or need space OR whether you are an anxious type that tends to cling and hold too tightly to love.</p>\r\n\r\n<p>Develop an evolutionary context for why you are in relationship to begin with that will inspire your future partner to want to take that journey alongside you.</p>'),
(3, 'Do I need to take this course with my romantic partner?', '<p>You have the option of taking this course with or without your partner for an additional $1. If you include your partner’s details (name and email)  they will also get their own login and will be encouraged to take our Relationship Dynamics Quiz.   You can take this course on your own to learn about yourself, the patterns and cycles you tend to get caught in and how to de-escalate and fully resolve conflicts.  It really only takes one of you willing to take one of the 8 key exit ramps we will be teaching you to begin the process of ending your conflicts.  So you are welcome to take this alone OR with your partner so you can both learn these critical relationship skills   \r\n</p>'),
(4, 'I’m single right now, will this Relationship Profile still be valuable for me?', '<p>Yes. It’s always incredibly valuable to understand yourself and others more deeply and filling out this quiz and receiving your profile when you are single is a great way for you to reflect on your past relationships and to look at the unique gifts you bring to others and the typical shadow patterns you might get caught in. This profile will help translate some of this knowledge into action as you uncover some of the remedies and relationship skills that you might want to develop. Although we recommend having a specific type of relationship in mind so that the profile accurately reflects how you tend to show up, you are welcome to reflect on your prior relationships and will gain a lot of insights that explain critically important dimensions of your particular relationship archetype.</p>'),
(5, 'I am in really dire straits with my partner and am already seeing a therapist, do you think this course is appropriate for me?', '<p>The short answer is yes. If you are in a relationship that’s having trouble, come to this course to rise above conflict and the patterns that create it and get step-by-step instructions on how to de-escalate and re-ignite your relationship into the love story it was meant to be.\r\n\r\nMaybe you sometimes feel frustrated, insecure, unseen/unheard, smothered, under-nourished, or not completely loved the way that you want. Maybe you’ve even decided these feelings are a “normal” part of relationships.\r\n\r\nCome to this course to rewrite your relationship DNA and break free from some of these patterns and with your partner you can find the hidden symmetries that keep you thinking your relationship is out of balance.\r\n\r\nDiscover how you might be unintentionally leaking safety and trust out of your relationship.\r\n\r\nLearn to use conflict as an opportunity to connect and grow as you learn how to dismantle your projects and safely heal old hurts.\r\n\r\nThere are some notable exceptions in cases of abuse, psychological or mental challenges, a history of physical or chemical abuse, and severe trauma which we would encourage and recommend getting 1:on:1 support from a trained professional.</p>'),
(6, 'I’m already in a great relationship is this course relevant for me?', '<p>If you are a couple in bliss, you are already committed to having the best relationship possible. Come to this course to practice the conversations and practices that will raise your relational quotient, learning to further develop the relational skills that will support you in maintaining an extraordinary relationship that continues to be consciousness, healthy, and set up to thrive.  We give you the tools to make sure your blissful relationship stays that way.</p>\r\n\r\n<p>We’ll teach you the distinctions that turn relationships from ordinary to extraordinary, and guide you as you co-create the evolutionary context to your relationship, up-leveling the way you relate and diffusing most conflict before it starts.</p>\r\n\r\n<p>Enjoy deep experiential exercises to keep your relationships hot and nearly drama free.</p>\r\n\r\n<p>Come ready to dive in with us and others who are excited to explore their deepest questions surrounding love, relationship, and intimacy.</p>'),
(7, 'How do I convince my partner to do this with me? ', '<p>This is an important question as you want your partner in your corner and perhaps even taking this alongside you. What we recommend is for you to think about and express to your partner the difference you feel this Course will make in your lives.</p>  \r\n\r\n<p>How will a small investment of your time and energy lead to a whole new outlook on your relationship and your day to day interactions? How it will improve your feelings about yourself? How it will improve your feelings about your partner? What new doors will open for you? How will it make you a better partner, lover, family member, and friend? And how all of that will contribute to a more fulfilling life. Then sit back and just listen. If your partner would like to contact us to have an exploratory call they can schedule that call with us by click here ‘Schedule an Appointment’ and we are happy to talk about their participation with someone on our team who can help them get clear.</p>'),
(8, 'Is there anything I should do to prepare for this course?', '<p>Once you register, you’ll receive both a link to the Relationship Archetype Quiz which we recommend everyone fill out prior to beginning the course. In it you’ll be asked some questions about your current relationship gifts & qualities, your most common patterns and cycles, your communication style, your biggest doubts and fears, what tends to trigger you most, etc. These questions will help us generate a personalized and comprehensive profile so that the solutions we go over in the course are tailored to your particular patterns and relationships.</p> \r\n\r\n<p>If you happen to be taking this course with someone, have them also fill out their quiz so they have their own Relationship Archetype Profile.</p>\r\n\r\n<p>Once you do that you are ready to begin - come with an open mind and an open heart ready to dive in to the 8 exit ramps and 5 stages of complete conflict Resolution that will help you permanently resolve your conflicts.</p>'),
(9, 'What will I learn in the Permanent Relationship Breakthrough Course?', '<p>Here\'s a peak at what you\'ll learn over the course of [format of this workshop course here, # days or # lessons]:\r\n\r\n- Find out about the 4 most common toxic cycles that are at the heart of nearly all conflict - learning which ones you get caught in most and how you might be polarizing your pattern in predictable ways.\r\n- Recognize what to do when you get triggered and how to de-escalate without giving up your truth \r\n- Get a personalized and comprehensive Relationship Archetype Profile where you\'ll get key insights about the relationship dynamics you are experiencing now \r\n- Learn the 5 Phases of Conflict Resolution...which ones you might be doing naturally and which ones you are leaving out\r\n- Discover why being good at \"conflict resolution\" - the way its normally taught - can actually hurt your relationships\r\n- Discover the 8 exit ramps that will help you end conflict and build a more extraordinary relationship.\r\n- Resolve once and for all your most painful recurring patterns and find out how to make sure your past conflicts don\'t come back to haunt your next relationship\r\n- Learn the critical relationship skills that will set you up to be an even better partner, collaborator, family member, or friend.</p>'),
(10, 'I can’t afford it, what do I do? Are there any discounts available?', '<p>We have a payment plan available for those that find it easier to pay smaller installments OR you can receive the discounted rate if you are able to pay it all at once.</p>\r\n\r\n<p>It’s our belief that an investment in the quality of your relating with others has a bigger impact than almost any other area you could spend your attention on. We get it. We’d like to offer you a new way of thinking that about this that will change the way you relate to yourself around money.<p>\r\n\r\n<p>Instead of focusing on why you can’t have what you want, start focusing on HOW you can and what the cost of not investing in this area will be a few months or years from now? Calculate how many hours of repeated patterns, headaches, hurts, and disappointments it would take to facilitate this kind of change…it would certainly be worth way more than that. Notice how much more empowering that is then feeling like you are trapped or don’t get to have what you desire. Focus on how you CAN.</p>\r\n\r\n<p>Next you can use a credit card to make the payment or can ask for the people in your life to help sponsor, loan, or gift you a ticket to come.</p>'),
(11, 'Is there a guarantee? What is your refund policy?', '<p>What we can guarantee is that you will be immersed in an incredible [live or online?] environment with a group of people earnestly invested in up-leveling the way they love and relate to one another in an experiential and transformational space facilitated by Bryan Franklin and Jennifer Russell to help you have a permanent breakthrough in your relationship.</p>\r\n\r\n<p>Of that we can be sure…of the rest, it’s all really based on what you decide to bring and the lens you choose to experience this course through. We encourage you to take accountability for the quality of your experience and gleaning the maximum amount of value that is meaningful to you.</p>\r\n\r\n<p>We currently have a 3-day cooling off period from the date of purchase during which time you can request in writing to get a 100% Refund of your money back no questions asked. You can also read our full Participation Agreement which has this policy in it.</p>'),
(12, 'Is this course right for me if I’m in a brand new relationship', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum commodo nisl ac pharetra aliquet.</p>'),
(39, 'gdghfhfh', '<p>rryryt</p>'),
(40, 'fsfsdf', '<p>sddgdghdf</p>'),
(41, '6+6 =', '<p>67657</p>');
INSERT INTO `permanent_breakthrough_rightcource` (`id`, `element_img`, `element_title`, `element_content`) VALUES
(1, '1683532252_product_1.jpg', 'As someone who is single right now, come to prepare yourself for a thriving relationship. Learn the skills and proven strategies to better understand both yourself and others so you can build a healthy relationship from the start.', '<p><strong>As someone who is single right now, come to prepare yourself for a thriving relationship.&nbsp; Learn the skills and proven strategies to better understand both yourself and others so you can build&nbsp; a healthy relationship from the start.</strong></p>\r\n\r\n<p>Come ready to unearth the blindspots and core patterns that are likely in the way from you finding true love and partnership.</p>\r\n\r\n<p>Learn how to heal insecure attachment whether you are an avoidant type who tends to run away or need space OR whether you are an anxious type that tends to cling and hold too tightly to love.</p>\r\n\r\n<p>Learn how to re-parent your wounded child so that you show up to your next relationship conscious, whole and complete.&nbsp; Heal and unlearn these patterns before entering into your next relationship so that you can show up as the extraordinary lover you were naturally born to be.</p>\r\n\r\n<p>Develop an evolutionary context for why you are in relationship to begin with that will inspire your future partner to want to take that journey alongside you.</p>'),
(2, '1684818200_Evolving Love Image - For Couples In Trouble.jpg', 'If you are in a relationship that ever faces challenges, come to this online event to identify and rise above the specific patterns that you get caught in most and learn personalized strategies that will support you to permanently resolve conflicts when they arise.', '<p><strong>If you are in a relationship that ever faces challenges, come to this online event to identify and rise above the specific patterns that you get caught in most and learn personalized strategies that will support you to permanently resolve conflicts when they arise.</strong></p>\r\n\r\n<p>Maybe you sometimes feel frustrated, insecure, unseen/unheard, smothered, under-nourished, or not completely loved the way that you want. Maybe you&rsquo;ve even decided these feelings are a &ldquo;normal&rdquo; part of relationships.</p>\r\n\r\n<p>Come ready to do the practices and have the conversations that will help you break free of some of these patterns.&nbsp; You&#39;ll find the hidden symmetries that keep you thinking your relationship is out of balance.</p>\r\n\r\n<p>Discover how you might be unintentionally leaking safety and trust out of your relationships. Learn to use conflict as an opportunity to connect and grow as you dismantle projections, embrace each other&rsquo;s shadows, and heal old hurts.</p>'),
(3, '1684818284_Evolving Love Image - Couples In Bliss.jpg', 'If you are a couple in bliss, you are already committed to having the best relationship possible. Come to create lasting change and healthy longevity that strengthens your relationship and evolves the way you love each other.', '<p><strong>If you are a couple in bliss, you are already committed to having the best relationship possible. Come to create lasting change and healthy longevity that strengthens your relationship and evolves the way you love each other.&nbsp;</strong></p>\r\n\r\n<p>We&rsquo;ll guide you as you co-create an inspiring and evolutionary context for your relationship, up-leveling the way you relate and learning how to diffuse most conflict before it starts.</p>\r\n\r\n<p>Enjoy lively discussions, experiential exercises and profound conversations that will spark growth and help you avoid misunderstandings.</p>\r\n\r\n<p>Get a personalized plan that outlines how to best love your partner given your unique gifts and theirs.</p>\r\n\r\n<p>Come dialogue with us about your deepest questions surrounding love and intimacy.</p>'),
(4, '1684818508_Evolving Love Image - Alone Or Together.png', 'IT WORKS ALONE OR TOGETHER', '<p><strong>IT WORKS ALONE OR TOGETHER<br />\r\nYou don&rsquo;t have to convince your partner to do this course with you </strong>in order to use the skills and conflict resolution process to heal old hurts in your relationship. Either partner can guide the conversation, and we&rsquo;ll teach you how to make it easy for your partner to resolve conflicts with you, even if you think they are resistant to learning or following a &ldquo;process&rdquo;.&nbsp;<br />\r\n<br />\r\nOf course, it is also fabulous to do this course with your partner, creating juicy conversations and intimate moments together.&nbsp;<br />\r\n<br />\r\nWe&rsquo;ve designed the exercises, practices, and live course interaction to work great if you are with your partner and work great if you are on your own. When it comes to resolving conflict, it actually only takes one to tango!</p>');
