INSERT INTO `testimonial` (`id`, `testimonial_title`, `testimonial_subtitle`, `testimonial_description`, `testimonial_name`, `testimonial_designation`, `testimonial_image`, `testimonial_status`, `created_at`, `updated_at`) VALUES
(1, 'Testimonials 1 updat', 'sub title', '<p>&ldquo;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.&rdquo;</p>', 'Kevin Kurgansky', 'The Breakup Doctor', '1677674593_Evolving Love Testimonial - Kevin Kurgansky (Circle).png', 0, '2023-03-01 12:03:18', '2023-03-01 12:03:18'),
(2, 'Testimonials 2', 'sub title 2', '<p>&ldquo;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.&rdquo;</p>', 'Eben Pagan,', 'Marketing & Dating Expert', '1677674695_Evolving Love Testimonial - Eben Pagan.png', 0, '2023-03-01 12:44:55', '2023-03-01 12:44:55'),
(3, 'Testimonials-1', 'testimonials-1', '<p><em>&ldquo;My partner and I got a series of tools to not only resolve our perpetual fights and conflicts, but also upgrade the very fabric of our relationship to become an exquisite crucible that allows us to transmute our problems into remarkable growth opportunities. I honestly cannot even imagine trying do &quot;love&quot; or &quot;relationships&quot; without these tools. Do yourself a service and do whatever it takes to learn this.&quot;</em></p>', 'Kevin Kurgansky', 'The Breakup Doctor', '1680176882_Evolving Love Testimonial - Kevin Kurgansky (Circle) (1).png', 1, '2023-03-30 11:48:02', '2023-03-30 11:48:02'),
(8, 'GREAT', 'Engagement', '<p>GREAT LOVE</p>', 'UPDATED TESTIMONIAL', 'NEW CUSTOMER', '1686894436_1_Sergio-Aguero.jpg', 1, '2023-06-16 05:47:16', '2023-06-16 05:47:16');
INSERT INTO `testimonial_1on1` (`id`, `testimonial_title_1on1`, `testimonial_subtitle_1on1`, `testimonial_description_1on1`, `testimonial_name_1on1`, `testimonial_designation_1on1`, `testimonial_image_1on1`, `testimonial_status_1on1`, `created_at`, `updated_at`) VALUES
(1, 'Testimonials 1', 'sub-tital-1', '<p><em>&ldquo;My partner and I got a series of tools to not only resolve our perpetual fights and conflicts, but also upgrade the very fabric of our relationship to become an exquisite crucible that allows us to transmute our problems into remarkable growth opportunities. I honestly cannot even imagine trying do &quot;love&quot; or &quot;relationships&quot; without these tools. Do yourself a service and do whatever it takes to learn this.&quot;</em></p>', 'Kevin Kurgansky', 'The Breakup Doctor', '1680177088_Evolving Love Testimonial - Kevin Kurgansky (Circle) (1).png', 0, '2023-03-30 11:51:28', '2023-03-30 11:51:28'),
(2, 'Testimonials 2', 'sub title 2', '<p><em>&ldquo;I&rsquo;ve spent multi-hour sessions with them and it was very unifying. They have this uncanny ability to really allow you to see your partner&rsquo;s perspectives and have your partner see yours. I saw a whole new way of doing love&mdash;got a whole new set of distinctions, new ideas, and new ways of seeing things. These are a couple of the best in the world.&rdquo;</em></p>', 'Eben Pagan', 'Marketing & Dating Expert', '1680177737_Evolving Love Testimonial - Eben Pagan (1).png', 0, '2023-03-30 12:02:17', '2023-03-30 12:02:17'),
(3, 'Testimonials 3', 'sub title 3', '<p><em>&quot;I feel like I&#39;ve been waiting for this information all my life. My lens of what a relationship can be has widened and expanded. I now have a definition and knowing of what an extraordinary/ evolutionary relationship looks like/feels like and I know the way I do relationship and the way I work with my clients is forever changed.&quot;</em></p>', 'Maya Diamond', 'MFT Therapist MA', '1680177850_Evolving Love Testimonial - Maya Diamond (Circle).png', 0, '2023-03-30 12:04:10', '2023-03-30 12:04:10'),
(4, 'True', 'Love', '<p>True&nbsp;Love</p>', 'Testimonial 5+', 'Shutter', '1683867786_images.jpg', 1, '2023-05-12 05:03:06', '2023-05-12 05:03:06'),
(5, 'TestimonialA++', 'Engagement', '<p>Engagement</p>', 'loving birds', 'DEVOPS', '1683874991_images1.jpg', 1, '2023-05-12 07:03:11', '2023-05-12 07:03:11'),
(9, 'LUCKY NUMBER', 'LUCKY NUMBER LOVE', '<p>LUCKY NUMBER FOR LOVE&nbsp;</p>', 'NEW TESTIMONIAL', 'CUSTOMER', '1686377633_1_Sergio-Aguero.jpg', 1, '2023-06-10 06:13:53', '2023-06-10 06:13:53');
