INSERT INTO `upgrade` (`id`, `upgrade_title`, `upgrade_description`, `upgrade_image`, `created_at`, `updated_at`, `upgrade_status`) VALUES
(1, 'SNEAK PREVIEW FOR [COMPASSIONATE ZEN MASTER]’S', '<p>Learn how your gift of&nbsp;<em>[User&rsquo;s Primary Gift]</em>&nbsp;positively impacts your most important relationships and how to communicate effectively with people who might not share your gift. Feel caught in a loop of&nbsp;<em>[User&rsquo;s Toxic Cycle]</em>? This step-by step guide points the way to healing that toxic cycle permanently.</p>', '1678798046_Evolving Love Product Image - Relationship Archetype Energetic Profile Page.png', '2023-03-14 12:47:26', '2023-03-14 12:47:26', 0),
(2, '24 LESSONS + 21 EVOLVING LOVE PRACTICES', '<p>You&rsquo;ll receive one of the most COMPREHENSIVE profiles ever created of the dynamics that are most active in your relationships right now. It&rsquo;s been custom built for you, with detailed explanation of each section of your profile. Make&nbsp;<em>[Current Year]</em>&nbsp;your best relationship year yet! Not all [Compassionate Zen Masters] are created equal. Learn what will work best for your specific Relationship Dynamics profile.</p>', '1678798219_Evolving Love Product Image - Relationship Archetype Course Practices.png', '2023-03-14 12:50:19', '2023-03-14 12:50:19', 0),
(3, 'First fifteen days free for trial basis...', '<p>First fifteen days free for trial base ..</p>', '1683877071_jacket.jpg', '2023-05-12 07:37:51', '2023-05-12 07:37:51', 1),
(4, 'sale offer -- flat 50% off', '<p>sale offer -- flat 50% off</p>', '1683887861_images (1).jpg', '2023-05-12 10:37:41', '2023-05-12 10:37:41', 1),
(5, 'First seven days free for trial base', '<p>First seven days free for trial baseFirst seven days free for trial baseFirst seven days free for trial baseFirst seven days free for trial base</p>', '1686545971_lionel-messi.webp', '2023-06-12 04:59:31', '2023-06-12 04:59:31', 1);
INSERT INTO `upgrade_profile` (`id`, `sec_1_title`, `sec_1_sub_title`, `sec_1_image_1`, `sec_1_image_2`, `sec_4_title`, `sec_4_sub_title`, `sec_5_title`, `sec_6_title`, `sec_6_sub_title`, `sec_6_description`, `sec_6_image`, `sec_6_backgroundimage`, `sec_7_amount`, `sec_8_title`, `sec_8_sub_title`, `sec_9_title`, `sec_9_sub_title`, `updated_at`, `created_at`) VALUES
(1, 'What The [Compassionate Zen Master] Needs To Know To Evolve The Way They Love', 'Upgrade Now To Unlock Your Full [40] Page Profile + 24 Lesson Step-By-Step Guide To Mastering Your Relationship Dynamics', '1678792895_Evolving Love Product Image - Relationship Archetype Full Profile + Course.png', '1678792908_Evolving Love Product Image - Relationship Archetype Course Pages (3).png', 'WHAT’S INCLUDED WHEN YOU UPGRADE', 'A 24 LESSON STEP BY STEP GUIDE TO HELP YOU MASTER YOUR RELATIONSHIP DYNAMICS', 'TOP 5 REASONS TO UPGRADE YOUR PROFILE', 'MEET YOUR TEACHERS & THE CREATORS OF THE RELATIONSHIP DYNAMICS PROFILE', 'CO-FOUNDERS OF  THE RELATIONSHIP DYNAMICS INSTITUTE | OVER 30,000 SESSIONS', '<p>Together Jennifer and Bryan have led 20 years of impactful transformational programs and events designed to liberate people from self-imposed limiting beliefs and unlock their evolutionary potential. They incorporate the best of Neurolinguistic Programming (NLP), the human potential movement, family systems, attachment theory, collaborative systems, neuroscience, spiritual practices, tribal circling technologies, and sacred theater.</p>\r\n\r\n<p>They are the co-founders of &#39;Evolving Love (https://relationshipdynamics.com), where they facilitate a series of retreats, workshops, and courses designed to rewrite your relational DNA so that you can embody your ideal love story</p>\r\n\r\n<p>They work with singles and couples to develop extraordinary relationships that point the way to significant personal evolution and the skills to develop a higher relational quotient (RQ). They are a stand for relationships that have a &#39;both / and&#39; rather than an &#39;either / or&#39; relationship to Freedom and Devotion and realize the true potential that healing the divide between the masculine and feminine ihas on creating a healed, healthy, and whole culture.</p>\r\n\r\n<p>They have developed powerful models that can help build the 3 pillars of any great relationship which are how to set the direction of your relationship, how to handle the valleys, and how to set the stage to experience the peaks.</p>', '1678792921_Hawaii-Bryan-and-Jennifer-BW.jpg', '1678792933_Evolving Love Sidebar & Practices Background - Red.png', '99', 'FREQUENTLY ASKED QUESTIONS', 'A SUBTITLE HERE THAT FEELS FRIENDLY AND LIKE WE’VE GOT THEIR ANSWERS', 'STILL GOT QUESTIONS OR NEED SUPPORT?', 'If you’ve still got questions or need support click ‘GET SUPPORT’ Below and someone from our team will get back to you soon.', '2023-03-14 10:53:40', '2023-03-14 10:53:40');
INSERT INTO `upsell_1_on_1` (`id`, `sec_1_title`, `sec_1_sub_title`, `sec_1_description`, `sec_1_image`, `sec_2_title`, `sec_2_col1_title`, `sec_2_col1_des`, `sec_2_col2_title`, `sec_2_col2_des`, `sec_2_col3_title`, `sec_2_col3_des`, `sec_2_image_bg`, `sec_3_col1_title`, `sec_3_col1_des`, `sec_3_col1_amount`, `sec_3_col2_title`, `sec_3_col2_des`, `sec_3_col2_amount`, `sec_4_title`, `sec_4_sub_title`, `sec_4_des`, `sec_4_image`, `sec_4_image_title`, `sec_4_image_bg`, `created_at`, `update_at`) VALUES
(1, 'Wanna Develop The Specific Relationship Skills That Will Support You In Becoming A Better Partner?', 'Get Your Personalized Relationship Dynamics Session', '<p>Your Relationship Dynamics profile is filled with knowledge, but knowing how to translate knowledge into action is challenging and that&rsquo;s exactly what these sessions are designed to do. Get 1:on:1 guidance on how to understand yourself, your partner and build the specific relationship skills that are most relevant to your current relationship.</p>\r\n\r\n<p>We&rsquo;ll take a look at some of your greatest relational gifts and some of the shadow patterns and cycles that you might get caught in and will work together to rewrite and fully resolve your most persistent patterns.</p>\r\n\r\n<h3><strong>Ever wonder what&rsquo;s really going on?</strong></h3>\r\n\r\n<p>Are you getting into arguments about the same things? Or maybe you just want to learn more about the state of your partnership and how you can be a better partner, family member, or friend?&nbsp; This session will give you the keys to creating extraordinary relationships with the people you care about most.</p>', '1684823068_Evolving Love Image - Upsell Master Your Relationship Dynamics Session.png', 'SOME OF WHAT YOU MIGHT GET FROM YOUR PRIVATE SESSIONS…', 'Counterintuitive Insights tailored to your situation', 'Gently guiding you to discover blind spots and see a more accurate picture of your most confounding patterns. They’ll also help you translate and understand your partner in new ways.', 'Decades of Experience in over 30,000 sessions', 'Bryan Franklin and Jennifer Russell have been trusted advisors, teachers, facilitators, and guides to their clients for decades. They are in an inspiring relationship and walk their talk.', 'Relationship Skills & Practices designed for you', 'We’ll introduce practices and skills based on your particular patterns and gifts that will help you make what you learn stick. We’ll give you exactly the tools you need.', '1680523635_Evolving Love Background Image - Android Jones Union (hires) (1).jpeg', 'SINGLE SESSION', 'Get one 90 minute session with Jennifer Russell or Bryan Franklin to help you master your relationship dynamics, gifts, & shadow patterns.', '495', '3 SESSION PACKAGE', 'Get three 90 minute session with Jennifer Russell or Bryan Franklin to help you master your relationship dynamics and develop specific relationship skills to become a better partner.', '1195', 'MEET YOUR TEACHERS & THE CREATORS OF THE RELATIONSHIP ARCHETYPE PROFILE', 'CO-FOUNDERS OF EVOLVING LOVE | RELATIONSHIP EXPERTS |& OVER 30,000 SESSIONS', '<p>Together Jennifer and Bryan have led 20 years of impactful transformational programs and events designed to liberate people from self-imposed limiting beliefs and unlock their evolutionary potential. They incorporate the best of Neurolinguistic Programming (NLP), the human potential movement, family systems, attachment theory, collaborative systems, neuroscience, spiritual practices, tribal circling technologies, and sacred theater.</p>\r\n\r\n<p>They are the co-founders of &#39;Relationship Dynamics Institute (<a href=\"https://relationshipdynamics.com\"><strong>https://relationshipdynamics.com</strong></a>), where they facilitate a series of retreats, workshops, and courses designed to rewrite your relational DNA so that you can&nbsp; embody your ideal love story</p>\r\n\r\n<p>They work with singles and couples to develop extraordinary relationships that point the way to significant personal evolution and the skills to develop a higher relational quotient (RQ). They are a stand for relationships that have a &#39;both / and&#39; rather than an &#39;either / or&#39; relationship to Freedom and Devotion and realize the true potential that healing the divide between the masculine and feminine ihas on creating a healed, healthy, and whole culture.</p>\r\n\r\n<p>They have developed powerful models that can help build the 3 pillars of any great relationship which are how to set the direction of your relationship, how to handle the valleys, and how to set the stage to experience the peaks.</p>', '1677587892_Hawaii-Bryan-and-Jennifer-BW.jpg', 'Jennifer Russell & Bryan Franklin', '1680523811_Evolving Love Sidebar & Practices Background - Red (1).png', '2023-02-28 11:18:51', '2023-02-28 11:18:51');
